import React from "react";
import {
  Nav,
  NavbarContainer,
  NavLogo,
  BtnSignin,
  BtnLogin,
  Buttons,
  NavMenu,
  NavItem,
  NavLinks,
  NavIcons,
} from "./NavbarElement";
export const Navbar = () => {
  return (
    <Nav>
      <NavbarContainer>
        <NavLogo to="/">Kagu.</NavLogo>
        <NavMenu>
          <NavItem>
            <NavLinks to="/">Acceuil</NavLinks>
          </NavItem>
          <NavItem>
            <NavLinks>Produits</NavLinks>
          </NavItem>
          <NavItem>
            <NavLinks>Contactez-nous</NavLinks>
          </NavItem>
        </NavMenu>
      </NavbarContainer>
    </Nav>
  );
};
export default Navbar;
